script: |
  super -f text -I q5232.spq | sort > q5232.out

inputs:
  - name: q5232.spq
    data: |
      SELECT ALL + col2 col2 FROM tab2 (FORMAT parquet) WHERE col0 + - - 80 * + - col1 BETWEEN - - 19 * - + col0 + + - CAST ( col0 AS INTEGER ) + + col1 * + 2 AND col0 * + col1 + - 92 / CAST ( 12 * - 26 AS INTEGER );
  - name: tab2

outputs:
  - name: q5232.out
    data: |
